var additionaldata=(doc)=>{
    const logo = 'data:image/png;base64,';
    //Remove the title created by datatTables
    doc.content.splice(0,1);
    var now = new Date();
    var jsDate = now.getDate()+'/'+(now.getMonth()+1)+'/'+now.getFullYear();
    // or one number for equal spread
    // It's important to create enough space at the top for a header !!!
    doc.pageMargins = [35,60];
    doc['header']=(function() {
        return {
            columns: [
                {
                    image: logo,
                    width: 25,
                },
                {
                    alignment: 'left',
                    text: 'Chicken Man',
                    // fontSize: 14,
                    margin: [10,2,0,0]
                },
                {
                    alignment: 'center',
                    text: $("title").html().trim().split('|')[0]+" ",
                    fontSize: 14,
                },
                {
                    alignment: 'right',
                    italics: true,
                    text: ['Created on: ', { text: jsDate.toString() }]
                }
            ],
            margin: 20
        }
    });
    doc['footer']=(function(page, pages) {
        return {
            columns: [
                {
                    alignment: 'left',
                    italics: true,
                    text: 'Developed and maintained by JM Tech Australia.'
                },
                {
                    alignment: 'right',
                    italics: true,
                    text: ['Page ', { text: page.toString() },	' of ',	{ text: pages.toString() }]
                },
                // {
                //     alignment: 'right',
                //     italics: true,
                //     text: 'Developed and maintained by JM Tech Australia.'
                // }
            ],
            margin: 10
        }
    });
}

function get_table_data(id, url, columns, footer = [], paging = true, serverSide = false, showButtons=true, bFilter=true) {
    // alert(url)
    // $('#'+id).DataTable().fnDestroy();
    // $('#' + id).append('<caption style="caption-side: bottom; margin-top: 10px">All informations are copyright to Chicken Man. </caption>');
    if ( $.fn.DataTable.isDataTable( '#' + id ) ) {
        $('#' + id).DataTable().destroy();
    }
    $.fn.dataTable.ext.errMode = 'none';
    const table = $('#' + id).DataTable({
        dom: 'Blfrtip',
        // "dom": '<"dt-buttons"Bf><"clear">lirtp',
        // "order": [
        //     [1, "asc"]
        // ],
        "processing": false,
        "serverSide": serverSide,
        "paging": paging,
        "search": true,
        "pageLength": 10,
        "select": false,
        "bFilter": bFilter,
        "bInfo": false,
        "responsive": true,
        "autoWidth": true,
        "columns": columns,
        "pagingType": "full_numbers",
        "lengthChange": true,
        "lengthMenu": [
            [10, 25, 50, 100],
            [10, 25, 50, 100],
        ],
        "language": {
            "processing": "Data is loading ..."
         },
        "bPaginate": true,
        "bLengthChange": true,
        "fnInitComplete": function(oSettings, json) {
            $(".dataTables_length .select2").select2({ 
              /* select2 options, as an example */
              minimumResultsForSearch: -1 
            });
          },
        "ajax": {
            "dataType": 'json',
            "type": 'GET',
            "contentType": 'application/json; charset=utf-8',
            "url": `/${url}`,
            "dataSrc": serverSide?"data":"",
            beforeSend: function(xhr) {
                xhr.setRequestHeader('authorization', `bearer ${localStorage.getItem('AcPro_Token')}`);
                $(".card-body").attr("style", "pointer-events:none;");
                $('.card-body').css({ 'opacity' : 0.5 });
                $(".dataTables_length").attr("style", "float: right; padding: 0 0 0 15px;");
            },
            // error: function(xhr) { 
            //     alert("Datatable error.")
            //     Spinner.Hide();
            // },
            complete: function(data) {
                if($('select[name="datatable-buttons_length"] option').length<5){
                    $('select[name="datatable-buttons_length"]').append($('<option>', {
                        value: data.responseJSON.recordsTotal,
                        text: 'All'
                    }));
                }
                $(".card-body").attr("style", "pointer-events:'';");
                $('.card-body').css({ 'opacity' : 1 });
            }
        },
        "buttons": showButtons?[{
            extend: 'copy',
                exportOptions: {
                    columns: ':visible',
                    search: 'applied',
                    order: 'applied'
                }
            }, {
                extend: 'print',
                exportOptions: {
                    columns: ':visible',
                    search: 'applied',
                    order: 'applied'
                },
                footer: true
            }, {
                extend: 'excel',
                exportOptions: {
                    columns: ':visible',
                    search: 'applied',
                    order: 'applied'
                },
                footer: true
            }, {
                extend: 'pdf',
                exportOptions: {
                    columns: ':visible',
                    search: 'applied',
                    order: 'applied'
                },
                footer: true,
                customize: function(doc){ additionaldata(doc) }
            }, 'colvis']:[],
            "footerCallback": function (row, data, start, end, display) {
            var api = this.api();

            // Remove the formatting to get integer data for summation
            var intVal = function (i) {
                return typeof i === 'string' ?
                    i.replace(/[\$,]/g, '') * 1 :
                    typeof i === 'number' ?
                    i : 0;
            };

            footer.forEach(element => {
                // Total over all pages
                total = api
                    .column(element)
                    .data()
                    .reduce(function (a, b) {
                        return intVal(a) + intVal(b);
                    }, 0);

                // Total over this page
                pageTotal = api
                    .column(element, {
                        page: 'current'
                    })
                    .data()
                    .reduce(function (a, b) {
                        return intVal(a) + intVal(b);
                    }, 0);

                // Update footer
                $(api.column(element).footer()).html(
                    // '$'+pageTotal +' ( $'+ total +' total)'
                    '$ ' + pageTotal.toFixed(3)
                );
            });

            if (footer.length > 0) {
                $(api.column(footer[0] - 1).footer()).html(
                    'Total :'
                );
                $("#tfoot").show();
            }
        }
        
    });

    if(showButtons){
        table.buttons().container()
        .appendTo('#datatable-buttons_wrapper .col-md-6:eq(0)');

        $('#datatable-buttons_filter').css("float", "right");
    }

    async function getBase64FromImageUrl(url) {
        debugger;
        if(!url){
            url=$(".logo-lg img").attr('src');
        }
        var img = new Image();
            img.crossOrigin = "anonymous";
        img.onload = function () {
            var canvas = document.createElement("canvas");
            canvas.width =this.width;
            canvas.height =this.height;
            var ctx = canvas.getContext("2d");
            ctx.drawImage(this, 0, 0);
            var dataURL = canvas.toDataURL("image/png");
            debugger;
            return dataURL.replace(/^data:image\/(png|jpg);base64,/, "");
        };
        img.src = url;
    }
}